import loginLogApi from '@/api/LoginLog.js'
export default {
  props: {
    user: {
      type: Object,
      default: () => {
        return {

        }
      }
    }
  },
  data () {
    return {
      timeline: []
    }
  },
  mounted () {
    this.getTimeLine()
  },
  methods: {
    getTimeLine () {
      loginLogApi.page({ current: 1, size: 10, model:{userId: this.user.id} })
        .then((response) => {
          const res = response.data
          this.timeline = res.data.records
        })

    }
  }
}
